CREATE PROCEDURE [dbo].[SDIF001]
    @ym char(6),
    @user_id varchar(256),
    @output_dir varchar(256)
AS

    DECLARE @cmd varchar(1024)
    DECLARE @now datetime = GETDATE()
    DECLARE @filename varchar(256) = @output_dir + ''\10SDIF00100000_'' + + CONVERT(varchar, @now, 112) + REPLACE(CONVERT(varchar, @now, 8), '':'', '''') + @user_id + ''.csv''

    SET @cmd = ''bcp "EXECUTE [INTRA_MART].[dbo].[SDIF001_SELECT] '''''' + @ym + ''''''" queryout '' + @filename + '' -f '' + @output_dir + ''\test.fmt -U sa -P P@ssw0rd''

    EXECUTE master.dbo.xp_cmdshell @cmd

EndSection:

    if @@error <> 0
        BEGIN
            RAISERROR ('''', 9, 1) WITH SETERROR, LOG
            return (9)
        END

    return (0)

' 
